const Jobs = props => (

    <div className="container">
        <div className="row">

            {
                props.jobs.map((job) => {

                    return (

                        <div className="col-md-4">

                            <div className="recipe__box">
                                <img className="recipe__box-img" src={job.company_logo} alt={job.company} />
                            </div>

                            <div className="recipe__text">
                                <h5>{ job.company }</h5>
                            </div>

                        </div>

                        // <div key={job.id}>


                        //     <p>{ job.title }</p>

                        // </div>
                    );
                }) 
            }

        </div>

    </div>
);

export default Jobs;
